import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import Link from "@material-ui/core/Link";
import CardActions from "@material-ui/core/CardActions";
import React from 'react';
import styles from './index.css'; 

function App() {
  return (
    <div>
      <div class="NavBar" style={styles.NavBar}>
        <h1 style={{flex: 3, paddingLeft: 100, color: "white"}}>ShopKart.</h1>
        <div style={{flex: 1, display: "flex", color: "white", justifyContent:"space-between", paddingRight: 20}}>
          <h3 style={{padding: 10}}>Products</h3>
          <h3 style={{padding: 10}}>Login</h3>
          <ShoppingCartIcon style={{paddingTop: 28, paddingLeft: 10, paddingRight: 10}} />
        </div>
      </div>
      <Card
        style={{
          height: "40%",
          width: "40%",
          display: "block",
          justifyContent: 'center',
          alignItems: 'center',
          margin: "auto",
          marginTop: "22%"
        }}
      >
        <CardContent>
          <h2>Login</h2>
        </CardContent>
        <CardActions style={{
          display: "block"
        }}>
          <TextField style={{width:"80%", padding: 10, paddingLeft: 15, backgroundColor: "aliceblue", borderRadius: 18, margin: 10}}placeholder="Email Address" InputProps={{ disableUnderline: true }}></TextField>
          <TextField style={{width:"80%", padding: 10, backgroundColor: "aliceblue", borderRadius: 18, margin: 10}} placeholder="Password" InputProps={{ disableUnderline: true }}></TextField>
          <Link style={{width:"50%", padding: 10, textC}}>New User? Create an Account</Link>
          <Button size="small" style={{width:"30%", padding: 10, backgroundColor: "#4267B2", }}>Login</Button>
        </CardActions>
      </Card>
    </div>
  );
}

export default App;
